import { makeStyles } from "@material-ui/core/styles";
import useMediaQuery from "@material-ui/core/useMediaQuery";

export default makeStyles((theme) => ({
	navBar: {
		backgroundColor: "#17202a",
		padding: "1rem 0",
		width: "50%",
		"@media (min-width: 780px)": {
			width: "80%",
		},
	},
	logo: {
		position: "absolute",
		left: "10px",
	},
	navLinks: {
		color: "#f39c12",
	},
	toolBar: {
		display: "flex",
		justifyContent: "center",
	},
}));
